import React from "react";

export default function Input({
  type,
  placeholder,
  onChange,
  value,
  name,
  required
}) {
  return (
    <input
      type={type}
      onChange={onChange}
      placeholder={placeholder}
      value={value}
      name={name}
      required={required}
    />
  );
}
